import React, { useState } from 'react'
import { Heading } from '../Heading/Heading';
import { Button } from '../Button/Button';
import Style from '../Panelist/Panelist.module.css';
import data from './data.json';

export const Panelist = () => {
  const [panelist, setPanelist] = useState([]);

  const fetchCallPanelist = () => {
    fetch("http://localhost:8080/JobVista/GetOpenings", {
      method: 'GET',
      headers: {
        'Content-type': 'Application/JSON'
      }
    })
      .then(response => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.json();
      })
      .then(result => {
        setOpeningsJson(result.Value);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }

  return (
    <div>
      <div className={Style.flx} id={Style.header}>
        <Heading>Panelist</Heading>
        <Button id={Style.panelistBtn}>Add Panelist</Button>
      </div>

      <ul id={Style.panelist} className={Style.flx}>
        <div id={Style.li}>
          <li>Name</li>
          <li>Email</li>
          <li>Gender</li>
          <li>Department</li>
          <li>Organization</li>
          <li>Roles</li>
        </div>
      </ul>

      {panelist.length === 0 ? (
        <div></div>
      ) : (
        <div id={Style.main}>
          {panelist.map((ele, ind) => (
            <ul className={Style.flx} key={ind} id={Style.lists}>
              <div id={Style.li}>
                <li>{ele.name}</li>
                <li>{ele.email}</li>
                <li>{ele.gender}</li>
                <li>{ele.dept}</li>
                <li>{ele.organization}</li>
                <li>{ele.role}</li>
              </div>
            </ul>
          ))}
        </div>
      )}


    </div>
  )
}
